  var doc = new jsPDF();

  function createPDF() {
    var imgData = 'data:image/jpeg;base64,';
    doc.setFont('times')
    doc.setFontType('roman')
    doc.setFontSize(40)
    doc.text(60, 25, 'Ponqués Chocorramo')
    doc.setFontSize(16)
    doc.text(60, 32, 'Imposible gastar en nosotros')
    doc.addImage(imgData, 'JPEG', 21, 10, 30, 30)
    doc.setFontSize(12)
    var usuario = $('#usuario').val();
    var cedula = $('#cedula').val();
    var monto = $('#monto').val();
    var periodicidad = $('input[name=Periodicidad]:checked').val();
    var plazo = $('select[name="years"]').val();
    switch (periodicidad) {
      case "12":
        periodicidad = "Mensual";
        break;
      case "4":
        periodicidad = "Trimestral";
        break;
      case "2":
        periodicidad = "Semestral";
        break;
    }
    var ea = $('#n1').val();
    var na = $('#n2').val();
    var pv = $('#n3').val();
    doc.text(20, 47, 'Señor')
    doc.text(31, 47, usuario);
    doc.text(20, 52, 'C.C:')
    doc.text(29, 52, cedula)
    doc.text(20, 67, 'Usted ha hecho una solicitud de cálculo con la siguiente información:')
    doc.text(20, 77, 'Prestamo: ')
    doc.text(38, 77, monto)
    doc.text(20, 87, 'Plazo:')
    doc.text(32, 87, plazo)
    doc.text(35, 87, 'años')
    doc.text(20, 97, 'Periodicidad:')
    doc.text(43, 97, periodicidad)
    doc.text(20, 117, 'De acuerdo a la solicitud, los intereses corresponden a:')
    doc.text(20, 127, 'Efectivo Anual (EA):')
    doc.text(58, 127, ea + '%')
    doc.text(20, 137, 'Nominal Anual (NA):')
    doc.text(59, 137, na + '%')
    doc.text(20, 147, 'Periodico Vencido (PV):')
    doc.text(64, 147, pv + '%')
    if (arguments[0] == 't') {
      var table = document.getElementById('tablaMora');
      var cuota = table.rows[1].cells[0].innerHTML;
      var fechaderetraso = table.rows[1].cells[1].innerHTML;
      var CuotaFijaMora = table.rows[1].cells[2].innerHTML;
      var interesdeMora = table.rows[1].cells[3].innerHTML;
      var flujodeCaja = table.rows[1].cells[4].innerHTML;
      var diasdeRetardo = $('#retardo').val();
      var ip = $('#IP').val();

      var res = fechaderetraso.split("/");
      var fecharetrasoAUX = new Date(res[2], res[1], res[0]);
      fecharetrasoAUX.setDate(fecharetrasoAUX.getDate() - parseInt(diasdeRetardo));
      var fecha1 = fecharetrasoAUX.getDate() + "/" + fecharetrasoAUX.getMonth() + "/" + fecharetrasoAUX.getFullYear();
      imprimirMora(cuota, fechaderetraso, CuotaFijaMora, interesdeMora, flujodeCaja, ip, diasdeRetardo, fecha1);
    } else {
      doc.text(20, 200, 'A continuacuón se presenta la tabla con la cual puede guiarse en el pago de las cuotas')

    }
    var tableInfo = Array.prototype.map.call(document.querySelectorAll('#tabla tr'), function(tr) {
      return Array.prototype.map.call(tr.querySelectorAll('td'), function(td) {
        return td.innerHTML;
      });
    });
    var tamaño = $('#tabla tr').length;
    var filasporpaginas = Math.ceil(tamaño / 22);

    var index = 1;
    for (var i = 0; i < filasporpaginas; i++) {
      var indexAUX = index + 22;
      imprimirPagina(tableInfo.slice(index, indexAUX));
      index = index + 22;
    }
    doc.save('Test.pdf');
    doc = new jsPDF();
  }

  function imprimirMora(NumCuota, fechaderetraso, CuotaFijaMora, interesdeMora, flujodeCaja, ip, diasdeRetardo, fecha1) {
    doc.text(20, 167, 'Se ha generado un retraso en el cumplimiento del pago periodico en la fecha ')
    doc.text(151, 167, fecha1)
    doc.text(172, 167, 'en la cuota ')
    doc.text(20, 174, 'número')
    doc.text(34, 174, NumCuota)
    doc.text(38, 174, '. El interes moratorio por el cual debe hacerse responsable es')
    doc.text(143, 174, '$' + interesdeMora + ',')
    doc.text(165, 174, 'obteniendo un ')
    doc.text(20, 181, 'interés periódico de')
    doc.text(55, 181, ip + '%.')
    doc.text(72, 181, 'Este valor correponde a ')
    doc.text(113, 181, diasdeRetardo)
    doc.text(116, 181, 'dias')
    doc.text(124, 181, '(' + fechaderetraso + ')')
    doc.text(148, 181, 'de mora, con una tasa de ')
    doc.text(20, 188, 'usura del  31,02%.')
    doc.setFontSize(15)
    doc.text(20, 195, 'Resumen por mora')
    doc.setFontSize(12)
    //Lineas horizontales
    doc.line(20, 200, 187, 200);
    doc.line(20, 210, 187, 210);
    doc.line(20, 220, 187, 220);
    //Lineas verticales
    doc.line(20, 200, 20, 220);
    doc.line(53, 200, 53, 220);
    doc.line(86, 200, 86, 220);
    doc.line(119, 200, 119, 220);
    doc.line(152, 200, 152, 220);
    doc.line(187, 200, 187, 220);
    //Nombres en la tabla
    doc.setFont('courier')
    doc.setFontType('normal')
    doc.text(26, 206, '# Cuota')
    doc.text(62, 204, 'Fecha')
    doc.text(59, 208, 'de pago')
    doc.text(90, 206, 'Cuota fija')
    doc.text(125, 204, 'Interes')
    doc.text(125, 208, 'de mora')
    doc.text(163, 204, 'Flujo')
    doc.text(160, 208, 'de caja')
    //Datos
    doc.setFont('times')
    doc.setFontType('roman')
    doc.text(23, 216, NumCuota)
    doc.text(55, 216, fechaderetraso)
    doc.text(88, 216, CuotaFijaMora)
    doc.text(121, 216, interesdeMora)
    doc.text(154, 216, flujodeCaja)

    doc.text(20, 240, 'A continuacuón se presenta la tabla con la cual puede guiarse en el pago de las cuotas')
  }

  function imprimirPagina(array) {
    doc.addPage();
    doc.setFont('courier')
    doc.setFontType('normal')
    doc.setFontSize(12);
    doc.text(22, 22, '# Cuota');
    doc.text(51, 22, 'Fecha');
    doc.text(75, 20, 'Saldo');
    doc.text(72, 25, 'Capital');
    doc.text(100, 20, 'Cuota');
    doc.text(102, 25, 'Fija');
    doc.text(123, 20, 'Amortiz.');
    doc.text(121, 25, 'a Capital');
    doc.text(146, 22, 'Intereses');
    doc.text(175, 20, 'Flujo');
    doc.text(173, 25, 'de Caja');
    doc.setFont('times')
    doc.setFontType('normal')
    doc.setFontSize(11);
    //line(algo,x,tamañolinea, y)
    //x y y deben ser lo mismo para que queden rectas

    var aumento = 15;
    for (var i = 0; i < array.length + 2; i++) {
      doc.line(20, i + aumento, 195, i + aumento);
      aumento = aumento + 10;
    }
    aumento = 0;
    for (var i = 0; i < array.length; i++) {
      //alert(tableInfo[i][0] + ", " + tableInfo[i][0] + ", " + tableInfo[i][1] + ", " + tableInfo[i][2] + ", " + tableInfo[i][3]+ ", " + tableInfo[i][4])
      doc.text(22, 33 + aumento, array[i][0].toString());
      doc.text(45, 33 + aumento, array[i][1].toString());
      doc.text(71, 33 + aumento, array[i][2].toString());
      doc.text(97, 33 + aumento, array[i][3].toString());
      doc.text(121, 33 + aumento, array[i][4].toString());
      doc.text(146, 33 + aumento, array[i][5].toString());
      doc.text(171, 33 + aumento, array[i][6].toString());
      aumento = aumento + 11;
    }
    aumento = 20;
    for (var i = 0; i < 8; i++) {
      doc.line(i + aumento, 15, i + aumento, (array.length * 12.75));
      aumento = aumento + 24;
    }

  }
